/*
name:        deviantART: snowy gruser v7 (rotane)
author:      rotane.deviantart.com
version:     1.0
*/

@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("deviantart.com") {

/* pre-format gruse box */
.mods-column-ll #gmi-GMFrame_Gruser > .gr-box:not(.gr-headless) > .gr1:not(.gb),
.mods-column-ll #gmi-GMFrame_Gruser > .gr-box:not(.gr-headless) > .gr2:not(.gb),
.mods-column-ll #gmi-GMFrame_Gruser > .gr-box:not(.gr-headless) > .gr3:not(.gb),
.mods-column-rr #gmi-GMFrame_Gruser > .gr-box:not(.gr-headless) > .gr1:not(.gb),
.mods-column-rr #gmi-GMFrame_Gruser > .gr-box:not(.gr-headless) > .gr2:not(.gb),
.mods-column-rr #gmi-GMFrame_Gruser > .gr-box:not(.gr-headless) > .gr3:not(.gb)
{ display: none !important; }

.mods-column-ll #gmi-GMFrame_Gruser > .gr-box > .gr-top,
.mods-column-rr #gmi-GMFrame_Gruser > .gr-box > .gr-top
{ border: none !important; background: transparent !important; }

/* box top */
.mods-column-ll #gmi-GMFrame_Gruser > .gr-box > .gr-top > .gr,
.mods-column-rr #gmi-GMFrame_Gruser > .gr-box > .gr-top > .gr 
{ border: none !important; border-bottom: 1px solid #A6B2A6 !important; 
  padding-bottom: 2px !important; 
  background: url(data:image/png;base64,) repeat-x bottom left !important; 
 }

/* left edge */
.mods-column-ll #gmi-GMFrame_Gruser > .gr-box > .gr-top > .gr:before,
.mods-column-rr #gmi-GMFrame_Gruser > .gr-box > .gr-top > .gr:before 
{ content:" " !important; display: block !important; position: absolute !important; 
  left: -7px !important; bottom: -20px !important; 
  width: 7px !important; height: 73px !important;
  background: url(data:image/png;base64,) bottom left no-repeat !important; 
 }

/* right edge (long) */
.mods-column-ll #gmi-GMFrame_Gruser > .gr-box > .gr-top > .gr:after,
.mods-column-rr #gmi-GMFrame_Gruser > .gr-box > .gr-top > .gr:after 
{ content:" " !important; display: block !important; position: absolute !important; z-index: 10 !important; 
  right: -7px !important; bottom: -19px !important; 
  width: 180px !important; height: 73px !important;
  background: url(data:image/png;base64,) bottom left no-repeat !important;   
 }

/* right edge alt (short) */
.mods-column-ll #gmi-GZone:nth-child(1) #gmi-GMFrame_Gruser:nth-child(3) > .gr-box > .gr-top > .gr:after,
.mods-column-ll #gmi-GZone:nth-child(1) #gmi-GMFrame_Gruser:last-child > .gr-box > .gr-top > .gr:after,
.mods-column-rr #gmi-GZone #gmi-GMFrame_Gruser > .gr-box > .gr-top.gr-top-alone > .gr:after
{ content:" " !important; display: block !important; position: absolute !important; 
  right: -7px !important; bottom: -19px !important; 
  width: 7px !important; height: 73px !important;
  background: url(data:image/png;base64,) bottom left no-repeat !important;   
 }

/* text format */
.mods-column-ll #gmi-GMFrame_Gruser > .gr-box > .gr-top > .gr > h2,
.mods-column-rr #gmi-GMFrame_Gruser > .gr-box > .gr-top > .gr > h2
{ margin-top: 0 !important; padding: 20px 2px 0px !important; position: relative !important; display: inline-block !important; z-index: 11 !important; 
  text-shadow: 0 1px 0 rgba(255,255,255,0.99) !important; 
 }

/* button format */
#gmi-GMFrame_Gruser .gm-controls 
{ top: 14px !important; right: -7px !important; }

/* snowman */
.mods-column-ll #gmi-GMFrame_Gruser:nth-child(2) > .gr-box > .gr-top > .gr > h2:after
{ content:" " !important; display: block !important; position: absolute !important; 
  right: -65px !important; bottom: 2px !important; 
  width: 37px !important; height: 34px !important;
  background: url(data:image/png;base64,) bottom left no-repeat !important;   
 }

/* icicle */
.mods-column-ll #gmi-GMFrame_Gruser:nth-child(2n+4) > .gr-box:not(.gr-headless) > .gr1.gb
{ margin-bottom: 25px !important; }

.mods-column-ll #gmi-GMFrame_Gruser:nth-child(2n+4) > .gr-box:not(.gr-headless) > .gr1.gb:after
{ content:" " !important; display: block !important; position: absolute !important; 
  right: 11px !important; top: 1px !important; 
  width: 40px !important; height: 27px !important;
  background: url(data:image/png;base64,) bottom left no-repeat !important;   
 }

}
